con:config.script:
import se.skl.rivta.testsupport.soapui.datasource.XmlDataReader
def projectPath = new com.eviware.soapui.support.GroovyUtils(context).projectPath def dataFile = new File(projectPath + "/data.xml")
def source = new XmlDataReader(context, dataFile) source.load("general test data") COOP=context.getProperty("COOP")
log.info "Testing on cooperation API on: ${COOP}"
testRunner.testCase.testSuite.setPropertyValue("COOP", COOP) testRunner.testCase.testSuite.setPropertyValue("projectPath", projectPath) testRunner.testCase.testSuite.setPropertyValue("wadl", "${projectPath}/schemas/takapi.wadl")

import groovy.json.JsonSlurper
def slurper = new JsonSlurper()

def json = slurper.parseText testRunner.testCase.getPropertyValue("serviceProductionId_list")
if (json.size > 0) {
	def id = json.pop()
	testRunner.testCase.setPropertyValue("serviceProductionId_list", json.toString())

	if (id) {
		testRunner.testCase.setPropertyValue("serviceProductionId", "${id}")
		testRunner.gotoStepByName("serviceProductions_ID")
	}
}
